2016-08-09 14:53:06 --- EMERGENCY: Database_Exception [ 1153 ]: Got a packet bigger than 'max_allowed_packet' bytes [ INSERT INTO `problem` (`problem_id`, `title`, `description`, `input`, `output`, `sample_input`, `sample_output`, `spj`, `hint`, `source`, `in_date`, `time_limit`, `memory_limit`, `defunct`, `accepted`, `submit`, `solved`) VALUES (NULL, 'Kyoya and Train', '&nbsp;\n\nKyoya Ootori wants to take the train to get to school. There are&nbsp;n&nbsp;train stations and&nbsp;m&nbsp;one-way train lines going between various stations. Kyoya is currently at train station&nbsp;1, and the school is at station&nbsp;n. To take a train, he must pay for a ticket, and the train also takes a certain amount of time. However, the trains are not perfect and take random amounts of time to arrive at their destination. If Kyoya arrives at school strictly after&nbsp;t&nbsp;time units, he will have to pay a fine of&nbsp;x.\nEach train line is described by a ticket price, and a probability distribution on the time the train takes. More formally, train line&nbsp;i&nbsp;has ticket cost&nbsp;ci, and a probability distribution&nbsp;pi,&thinsp;k&nbsp;which denotes the probability that this train will take&nbsp;k&nbsp;time units for all&nbsp;1&thinsp;&le;&thinsp;k&thinsp;&le;&thinsp;t. Amounts of time that each of the trains used by Kyouya takes are mutually independent random values (moreover, if Kyoya travels along the same train more than once, it is possible for the train to take different amounts of time and those amounts are also independent one from another).\nKyoya wants to get to school by spending the least amount of money in expectation (for the ticket price plus possible fine for being late). Of course, Kyoya has an optimal plan for how to get to school, and every time he arrives at a train station, he may recalculate his plan based on how much time he has remaining. What is the expected cost that Kyoya will pay to get to school if he moves optimally?\n', 'The first line of input contains four integers&nbsp;n,&thinsp;m,&thinsp;t,&thinsp;x&nbsp;(2&thinsp;&thinsp;&le;&thinsp;&thinsp;n&thinsp;&thinsp;&le;&thinsp;50,&nbsp;1&thinsp;&le;&thinsp;m&thinsp;&le;&thinsp;100,&nbsp;1&thinsp;&le;&thinsp;t&thinsp;&le;&thinsp;20&thinsp;000,&nbsp;0&thinsp;&le;&thinsp;x&thinsp;&le;&thinsp;106).\nThe next&nbsp;2m&nbsp;lines contain the description of the trains.\nThe&nbsp;2i-th line will have&nbsp;3&nbsp;integers&nbsp;ai,&thinsp;bi,&thinsp;ci, representing a one way train from station&nbsp;ai&nbsp;to&nbsp;bi&nbsp;with ticket cost&nbsp;ci&nbsp;(1&thinsp;&le;&thinsp;ai,&thinsp;bi&thinsp;&le;&thinsp;n,&nbsp;ai&thinsp;&ne;&thinsp;bi,0&thinsp;&le;&thinsp;ci&thinsp;&le;&thinsp;106). There will always be at least one path from any station to the school.\nThe&nbsp;(2i&thinsp;+&thinsp;1)-th line will contain&nbsp;t&nbsp;integers,&nbsp;pi,&thinsp;1,&thinsp;pi,&thinsp;2,&thinsp;...,&thinsp;pi,&thinsp;t&nbsp;where&nbsp;pi,&thinsp;k&thinsp;/&thinsp;100000&nbsp;is the probability that this train will take&nbsp;k&nbsp;units of time to traverse (0&thinsp;&le;&thinsp;pi,&thinsp;k&thinsp;&le;&thinsp;100&thinsp;000&nbsp;for&nbsp;1&thinsp;&le;&thinsp;k&thinsp;&le;&thinsp;t, &nbsp; &nbsp;(k=1)&sum;(t) &nbsp;pi,&thinsp;k &nbsp;=&nbsp;100000.\nIt is guaranteed that there is no more than one train between each pair of platforms in each of the directions.', 'Print a single real number that is equal to an optimal expected cost of getting to school. The answer will be considered correct if its relative or absolute error doesn\'t exceed&nbsp;10&thinsp;-&thinsp;6.', '第一个例子：\n4 4 5 1\n1 2 0\n50000 0 50000 0 0\n2 3 0\n10000 0 0 0 90000\n3 4 0\n100000 0 0 0 0\n2 4 0\n0 0 0 50000 50000\n\n第二个例子：\n0.7000000000\n', '第一个例子：\n4 4 5 1\n1 2 100\n50000 0 50000 0 0\n2 3 100\n10000 0 0 0 90000\n3 4 100\n100000 0 0 0 0\n2 4 100\n0 0 0 50000 50000\n\n第二个例子：\n200.7500000000', 0, 'The optimal strategy in the first case is as follows:\nFirst, travel along first train line. With probability&nbsp;1&thinsp;/&thinsp;2&nbsp;Kyoya will take&nbsp;1&nbsp;time unit. Otherwise, Kyoya will take&nbsp;3&nbsp;time units.\nIf the train takes&nbsp;1&nbsp;time unit, travel along the 4th train line. Kyoya will make it to school in time with probability&nbsp;1&thinsp;/&thinsp;2. Otherwise, if the train takes 3 time units, travel along the 2nd train line. Kyoya will make it to school in time with probability&nbsp;1&thinsp;/&thinsp;10.\nSince the cost of all train lines are zero, we can just look at the probability that Kyoya will incur the penalty. The probability that Kyoya will have to pay the penalty is&nbsp;1&thinsp;/&thinsp;2&thinsp;&times;&thinsp;1&thinsp;/&thinsp;2&thinsp;+&thinsp;1&thinsp;/&thinsp;2&thinsp;&times;&thinsp;9&thinsp;/&thinsp;10&thinsp;=&thinsp;7&thinsp;/&thinsp;10. We can show that no other strategy is strictly better.\nThe optimal strategy in the second case is to travel along&nbsp;1&thinsp;&rarr;&thinsp;2&thinsp;&rarr;&thinsp;4&nbsp;no matter what. Kyoya will incur the penalty with probability&nbsp;3&thinsp;/&thinsp;4, and the cost of the trains is&nbsp;200, thus the expected cost is&nbsp;200.75.', 'contest E 553', '2016-08-09 14:53:06', '8', '512', 'Y', NULL, 0, 0) ] ~ MODPATH/database/classes/Kohana/Database/MySQLi.php [ 171 ] in /home/OnlineJudge/modules/database/classes/Kohana/Database/Query.php:251
